import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link,
  useRouteMatch,
  useParams
} from "react-router-dom";
import Home from "./pages/Home";
import Profile from "./pages/Profile";

function App() {
  return (
    <Router>
    <Switch>
      <Route path="/profile" component={Profile}></Route>
      <Route path="/" exact component={Home}></Route>
    </Switch>
    </Router>
  );
}

export default App;
